import { Link } from "react-router-dom";
import { useState } from "react";
import "./AddAPet.scss";
import APIURL from "./APIURL";

const AddAPet = () => {
    const [roundedAge, setRoundedAge] = useState("");
    const submitForm = async (event) => {
        console.log("submitForm()");
        console.log("event: ", event);
        console.log(event.target.elements);
        event.preventDefault();
        console.log(
            "PHOTO.VALUE:",
            typeof event.target.elements.photo.value,
            "[" + event.target.elements.photo.value + "]"
        );
        const file = event.target.elements.photo.value;
        const fileType = file && file["type"].split("/")[0];
        // const myStr = "Andy,Beth,Corrie"
        // const myAr = myStr.split(",")
        // ["A","B","C"]
        console.log(file["type"].split("/")[0]);
        console.log("fileType: ", fileType);

        if (
            event.target.elements.name.value === "" ||
            event.target.elements.age.value === "" ||
            event.target.elements.breed.value === "" ||
            event.target.elements.county.value === "" ||
            event.target.elements.description.value === ""
        ) {
            alert("All fields are required");
        } else {
            const formData = new FormData(event.target);
            const response = await fetch(`${APIURL}/availablePets`, {
                method: "POST",
                body: formData,
            });
        }
    };
    const roundAge = (event) => {
        const ageInput = event.target;
        const currentAge = ageInput.value;
        let ageRounded = Math.round(currentAge);
        if (ageRounded === 0) {
            ageRounded = "";
        }
        setRoundedAge(ageRounded);

        //const roundedAge = Math.round(event.target.value);
    };
    return (
        <>
            <div className="container" id="addAPet">
                <div className="row">
                    <div className="col-8">
                        <h1>
                            <Link to="/">Find Your Furever Friend</Link>
                        </h1>
                    </div>
                    <div className="col-4">
                        <h6>
                            <Link to="/ShelterViewMyAnimals">
                                View My Animals
                            </Link>
                        </h6>
                    </div>
                </div>

                <form onSubmit={submitForm}>
                    <div className="row">
                        <div className="col-25">
                            <label htmlFor="name">Name*</label>
                        </div>
                        <div className="col-75">
                            <input
                                type="text"
                                id="name"
                                name="name"
                                // placeholder="Name.."
                            />
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label htmlFor="age">Age*</label>
                        </div>
                        <div className="col-75">
                            <input
                                type="number"
                                min="0"
                                step="1"
                                id="age"
                                name="age"
                                onChange={roundAge}
                                value={roundedAge}

                                // placeholder="Age.."
                            />
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label htmlFor="breed">
                                Breed <h id="NA">(NA if not applicable)</h>*
                            </label>
                        </div>
                        <div className="col-75">
                            <input
                                type="text"
                                id="breed"
                                name="breed"
                                // placeholder="Breed (if known).."
                            />
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label htmlFor="country">County*</label>
                        </div>
                        <div className="col-75">
                            <select id="county" name="county">
                                <option value=""></option>
                                <option value="onondaga">Onondoga</option>
                                <option value="cortland">Cortland</option>
                                <option value="oswego">Oswego</option>
                            </select>
                        </div>
                    </div>
                    <div className="row">
                        <div className="col-25">
                            <label htmlFor="subject">Description*</label>
                        </div>
                        <div className="col-75">
                            <textarea
                                id="description"
                                name="description"
                                // placeholder="Write something.."
                                // style="height: 200px"
                            ></textarea>
                        </div>
                    </div>
                    <div className="row">
                        <p>
                            Click on the "Choose file" button to upload a file:
                        </p>
                        <input
                            type="file"
                            name="photo"
                            accept="image/.pdf,.jpg,.gif,.png"
                        />
                        <h6 id="required">* Required Field</h6>
                    </div>
                    <div className="row">
                        <button type="submit" id="submitButton">
                            Submit
                        </button>
                    </div>
                </form>
            </div>
        </>
    );
};

export default AddAPet;

